import React, { useState, useEffect } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  Box,
  useTheme,
  useMediaQuery,
  Container,
  useScrollTrigger,
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Link as RouterLink } from 'react-router-dom';
import { styled } from '@mui/material/styles';

const StyledAppBar = styled(AppBar)(({ theme, trigger }) => ({
  background: trigger 
    ? 'rgba(255, 255, 255, 0.95)'
    : 'transparent',
  boxShadow: trigger 
    ? '0 2px 28px rgba(0,0,0,0.1)'
    : 'none',
  backdropFilter: trigger ? 'blur(20px)' : 'none',
  transition: 'all 0.3s ease',
  '& .MuiToolbar-root': {
    transition: 'all 0.3s ease',
    minHeight: trigger ? '70px' : '80px',
  },
}));

const Logo = styled(Typography)(({ theme, trigger }) => ({
  fontWeight: 800,
  fontSize: trigger ? '1.5rem' : '1.8rem',
  background: 'linear-gradient(45deg, #1a237e, #0d47a1)',
  WebkitBackgroundClip: 'text',
  WebkitTextFillColor: 'transparent',
  letterSpacing: 1,
  cursor: 'pointer',
  transition: 'all 0.3s ease',
}));

const NavButton = styled(Button)(({ theme, trigger }) => ({
  color: trigger ? theme.palette.primary.main : '#fff',
  marginLeft: theme.spacing(2),
  padding: theme.spacing(1, 2),
  borderRadius: '8px',
  fontSize: '1rem',
  fontWeight: 500,
  textTransform: 'none',
  transition: 'all 0.2s ease',
  position: 'relative',
  '&::after': {
    content: '""',
    position: 'absolute',
    bottom: '6px',
    left: '50%',
    transform: 'translateX(-50%)',
    width: '0%',
    height: '2px',
    background: theme.palette.primary.main,
    transition: 'all 0.3s ease',
  },
  '&:hover': {
    backgroundColor: 'transparent',
    '&::after': {
      width: '80%',
    },
  },
}));

const MobileDrawer = styled(Drawer)(({ theme }) => ({
  '& .MuiDrawer-paper': {
    width: 280,
    background: 'linear-gradient(to bottom, #1a237e, #0d47a1)',
    color: '#fff',
    padding: theme.spacing(2),
  },
}));

const MobileNavItem = styled(ListItem)(({ theme }) => ({
  borderRadius: '8px',
  marginBottom: theme.spacing(1),
  transition: 'all 0.2s ease',
  '&:hover': {
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
  },
  '& .MuiListItemText-primary': {
    fontSize: '1.1rem',
    fontWeight: 500,
  },
}));

const Navbar = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 100,
  });

  const menuItems = [
    { text: 'Home', path: '/' },
    { text: 'About', path: '/about' },
    { text: 'Courses', path: '/courses' },
    { text: 'Events', path: '/events' },
    { text: 'Contact', path: '/contact' },
  ];

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <Box>
      <Box sx={{ mb: 4, mt: 2, textAlign: 'center' }}>
        <Logo variant="h6" component={RouterLink} to="/" trigger={false}>
          COLLEGE NAME
        </Logo>
      </Box>
      <List>
        {menuItems.map((item) => (
          <MobileNavItem
            button
            key={item.text}
            component={RouterLink}
            to={item.path}
            onClick={handleDrawerToggle}
          >
            <ListItemText 
              primary={item.text} 
              sx={{ textAlign: 'center' }}
            />
          </MobileNavItem>
        ))}
      </List>
    </Box>
  );

  return (
    <>
      <StyledAppBar position="fixed" trigger={trigger}>
        <Container maxWidth="lg">
          <Toolbar disableGutters>
            <Logo
              variant="h6"
              component={RouterLink}
              to="/"
              trigger={trigger}
              sx={{ flexGrow: 1 }}
            >
              COLLEGE NAME
            </Logo>
            {isMobile ? (
              <IconButton
                color={trigger ? 'primary' : 'inherit'}
                aria-label="open drawer"
                edge="start"
                onClick={handleDrawerToggle}
                sx={{
                  ml: 2,
                  backgroundColor: trigger ? 'rgba(0,0,0,0.04)' : 'rgba(255,255,255,0.1)',
                  '&:hover': {
                    backgroundColor: trigger ? 'rgba(0,0,0,0.08)' : 'rgba(255,255,255,0.2)',
                  },
                }}
              >
                <MenuIcon />
              </IconButton>
            ) : (
              <Box sx={{ display: 'flex' }}>
                {menuItems.map((item) => (
                  <NavButton
                    key={item.text}
                    component={RouterLink}
                    to={item.path}
                    trigger={trigger}
                  >
                    {item.text}
                  </NavButton>
                ))}
              </Box>
            )}
          </Toolbar>
        </Container>
      </StyledAppBar>
      <MobileDrawer
        variant="temporary"
        anchor="right"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
      >
        {drawer}
      </MobileDrawer>
      <Toolbar /> {/* Spacing below the fixed AppBar */}
    </>
  );
};

export default Navbar;
